import React from 'react';
import { NativeBaseProvider, Box, Text } from 'native-base';

import AddTaskBox from './components/AddTaskBox';

export default function App() {
  return (
    <NativeBaseProvider>
      <AddTaskBox />
    </NativeBaseProvider>
  );
}
